import React from "react";

export default function TextForm() {
  return (
    <div className="container">
      <div className="mb-3">
          Example textarea
        <label for="exampleFormControlTextarea1" className="form-label"><strong></strong></label>
        <textarea
          className="form-control"
          id="exampleFormControlTextarea1"
          rows="7"
        ></textarea>
      </div>
    </div>
  );
}
